import React from "react";

function SectorCard({ data: { img, title, content, type, dispatch } }) {
  return (
    <div
      className="sector-card"
      onClick={() => {
        dispatch(type);
      }}
    >
      <div className="img-wrapper">{img}</div>
      <div className="title">{title}</div>
      {content}
    </div>
  );
}

export default SectorCard;
